--Use metatables to fill-up missing zoneIds of languages missing entries with the English ones
local referenceZoneNamesEN = preloadedZoneNames["en"]
--Vanilla client languages, should not need this!
--setmetatable(preloadedZoneNames["de"], {__index = referenceZoneNamesEN})
--setmetatable(preloadedZoneNames["fr"], {__index = referenceZoneNamesEN})
--setmetatable(preloadedZoneNames["ru"], {__index = referenceZoneNamesEN})
--setmetatable(preloadedZoneNames["es"], {__index = referenceZoneNamesEN})
--setmetatable(preloadedZoneNames["zh"], {__index = referenceZoneNamesEN})
--Special client languages
setmetatable(preloadedZoneNames["jp"], {__index = referenceZoneNamesEN})
--Custom langauges
setmetatable(preloadedZoneNames["pl"], {__index = referenceZoneNamesEN})

--Provide this translated data to the global library variable
lib.preloadedZoneNames = preloadedZoneNames


--Entries in this table "zoneIdsOfDifferentAPIVersion" will be removed from all zoneData tables below if the current
--games's APIversion is below the key of the sub-table below.
--e.g. the table zoneIdsOfDifferentAPIVersion below contains a subtable 100031. So all entries in there will first be
--available within the LibZone data tables if the game's function GetAPIVersion() returns 100031 or higher!
local zoneIdsOfDifferentAPIVersion = {
	--Updated: API1010xx
	--1 table key with the APIversion, and then a List of zoneIds as values below that APIversion table
	--All APIversion lower than that will remove the zoneIds from the LibZone internal data tables
	--Example
	--[1010xx] = {
	--	1234,1245,1267,...
	--},

	--Updated: API101044 Update 44
}

--Dynamically try to add the zoneIds to the table above, which got no name string
local nextApi = GetAPIVersion() + 1
zoneIdsOfDifferentAPIVersion[nextApi] = {}

for lang, zoneData in pairs (preloadedZoneNames) do
	--Only check the current client language
	if lang == clientLang then
		for zoneId, zoneNamePreloaded in pairs(zoneData) do
			local zoneIdOfOtherAPI = false
			local currentAPIsZoneName = GetZoneNameById(zoneId)
			if currentAPIsZoneName == nil or currentAPIsZoneName == "" then
				zoneIdOfOtherAPI = true
			end
			if zoneIdOfOtherAPI == true then
				--df("[".. libName .. "]Added zoneId %s (\'%s\') to zones of API %s.", tostring(zoneId), tostring(zoneNamePreloaded), tostring(nextApi))
				table.insert(zoneIdsOfDifferentAPIVersion[nextApi], zoneId)
			end
		end
	end
end

--Remove non.live zoneIds from the LibZone data tables
local function removeNonLiveAPIVersionEntriesFromLibZoneData()
	if zoneIdsOfDifferentAPIVersion and preloadedZoneNames then
		local checkIfLanguageIsSupported = lib.checkIfLanguageIsSupported
		local currentAPIVersion = lib.currentAPIVersion or GetAPIVersion()
		for apiVersionToCheck, zoneIdsToRemove in pairs(zoneIdsOfDifferentAPIVersion) do
			if apiVersionToCheck ~= nil and type(apiVersionToCheck) == "number" and apiVersionToCheck >= 100000 then
				if apiVersionToCheck > currentAPIVersion then
					for languageToCheck, zoneIds in pairs(preloadedZoneNames) do
						if checkIfLanguageIsSupported(languageToCheck) == true then
							for _, zoneIdToRemove in ipairs(zoneIdsToRemove) do
								if zoneIds[zoneIdToRemove] ~= nil then
									preloadedZoneNames[languageToCheck][zoneIdToRemove] = nil
								end
							end
						end
					end
				end
			end
		end
	end
end
removeNonLiveAPIVersionEntriesFromLibZoneData()